: Percent","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2020 count of the Owner-Occupied Housing Units. A housing unit is owner-occupied if the owner or co-owner lives in the unit, even if it is mortgaged or not fully paid for. Source U.S. Census 2020 DHC. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"KEYUSFACTSOWNER_CY_P":{"type":"number","alias":"2024 Owner Occupied HUs: Percent","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of Owner-Occupied Housing Units in the geographic area. A housing unit is owner-occupied if the owner or co-owner lives in the unit. A housing unit is a house, an apartment, a mobile home, a group of rooms, or a single room that is occupied (or if vacant, is intended for occupancy) as separate living quarters.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSOWNER_FY_P":{"type":"number","alias":"2029 Owner Occupied HUs: Percent","vintage":"2029","source":"Esri","units":null,"decimals":null,"definition":"Esri 2029 five-year forecast for Owner-Occupied Housing Units in the geographic area. Owner-Occupied Housing Units are Housing Units where the primary occupant is the owner or co-owner of the property. Housing Units are living quarterssuch as a house, apartment, mobile home, or roomsin which the occupant(s) live separately from individuals who are not part of their household and to which they have free, direct access. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"OWNERRENTERRENTER00_P":{"type":"number","alias":"2000 Renter Occupied HUs: Percent","vintage":"2000","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2000 count of the Renter-Occupied Housing Units in the geographic area. Renter-Occupied Housing Units are any occupied housing unit that is not Owner-Occupied, whether rented or occupied without payment of rent."},"HOUSINGUNITTOTALSRENTER10_P":{"type":"number","alias":"2010 Renter Occupied Hus: Percent","vintage":"2010","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2010 count of the Renter-Occupied Housing Units in the geographic area. Renter-Occupied Housing Units are any occupied housing unit that is not Owner-Occupied, whether rented or occupied without payment of rent.  See <a target='_blank' //links.esri.com/demographics/2010-census'>Census 2010</a> for more information."},"HOUSINGUNITTOTALSRENTER20_P":{"type":"number","alias":"2020 Renter Occupied HUs: Percent","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2020 base for Renter Occupied Housing Units by Size. This base variable is used to calculate the percentage of Renter Occupied Housing Units by Size . Source U.S. Census 2020 DHC. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"KEYUSFACTSRENTER_CY_P":{"type":"number","alias":"2024 Renter Occupied HUs: Percent","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Renter-Occupied Housing Units in the geographic area. All occupied housing units which are not owner-occupied, whether they are rented or occupied without payment of rent, are classified as renter-occupied. A housing unit is a house, an apartment, a mobile home, a group of rooms, or a single room that is occupied (or if vacant, is intended for occupancy) as separate living quarters.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSRENTER_FY_P":{"type":"number","alias":"2029 Renter Occupied HUs: Percent","vintage":"2029","source":"Esri","units":null,"decimals":null,"definition":"Esri 2029 five-year forecast for Renter-Occupied Housing Units in the geographic area. Renter-Occupied Housing Units are any occupied housing unit that is not Owner-Occupied, whether rented or occupied without payment of rent. Housing Units are living quarterssuch as a house, apartment, mobile home, or roomsin which the occupant(s) live separately from individuals who are not part of their household and to which they have free, direct access. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POPULATIONTOTALSPOPGRW0020":{"type":"number","alias":"2000-2020 Growth Rate: Population","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"The 2000-2020 population compound annual growth rate (CAGR) is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of persons between the years 2000 and 2020. An annualized rate means that the resultant value reflects a rate of change covering a twelve-month time period. This component of the calculation permits the analysis of multiple growth rates between values measured from differing points in time since the change is computed using a common time period of twelve months. The compound component of the expression simply means that the annualized growth rate is repeated, or compounded, each year. Moreover, the CAGR can colloquially be referred to as growth rate, annual rate, annualized growth rate, or compound growth rate. See the variable formula used at: https://doc.arcgis.com/en/esri-demographics/reference/essential-vocabulary.htm See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"HOUSEHOLDTOTALSHHGRW0020":{"type":"number","alias":"2000-2020 Growth Rate: Households","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"The 2000-2020 household compound annual growth rate (CAGR) is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of households between the years 2000 and 2020. An annualized rate means that the resultant value reflects a rate of change covering a twelve-month time period. This component of the calculation permits the analysis of multiple growth rates between values measured from differing points in time since the change is computed using a common time period of twelve months. The compound component of the expression simply means that the annualized growth rate is repeated, or compounded, each year. Moreover, the CAGR can colloquially be referred to as growth rate, annual rate, annualized growth rate, or compound growth rate. See the variable formula used at: https://doc.arcgis.com/en/esri-demographics/reference/essential-vocabulary.htm See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"HOUSINGUNITTOTALSHUGRW0020":{"type":"number","alias":"2000-2020 Growth Rate: Housing Units","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"The 2000-2020 housing unit compound annual growth rate (CAGR) is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of housing units between the years 2000 and 2020. An annualized rate means that the resultant value reflects a rate of change covering a twelve-month time period. This component of the calculation permits the analysis of multiple growth rates between values measured from differing points in time since the change is computed using a common time period of twelve months. The compound component of the expression simply means that the annualized growth rate is repeated, or compounded, each year. Moreover, the CAGR can colloquially be referred to as growth rate, annual rate, annualized growth rate, or compound growth rate. See the variable formula used at: https://doc.arcgis.com/en/esri-demographics/reference/essential-vocabulary.htm See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"HOUSINGUNITTOTALSTOTHU10":{"type":"number","alias":"2010 Total Housing Units","vintage":"2010","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2010 count of the Total Housing Units in the geographic area. See <a target='_blank' //links.esri.com/demographics/2010-census'>Census 2010</a> for more information."},"HOUSINGUNITTOTALSTOTHU20":{"type":"number","alias":"2020 Total Housing Units","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"Total Housing Units (occupied and vacant). Housing units are classified as being either occupied or vacant. These are living quarters in which the occupant or occupants live separately from any other individuals in the building and have direct access to their living quarters from outside the building or through a common hall. Housing units are usually houses, apartments, mobile homes, groups of rooms, or single rooms that are occupied as separate living quarters. They are residences for single individuals, for groups of individuals, or for families who live together. For vacant housing units, the criteria of separateness and direct access are applied to the intended occupants whenever possible. Nontraditional living quarters, such as boats, RVs, and tents, are considered housing units only if someone is living in them and they are either the occupants usual residence or the occupant has no usual residence elsewhere. These nontraditional living arrangements are not considered housing units if they are vacant. Source U.S. Census 2020 DHC. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"HISTORICALHOUSINGTOTHU_CY":{"type":"number","alias":"2024 Total Housing Units","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of Total Housing Units, occupied or vacant, in the geographic area. A housing unit is a house, an apartment, a mobile home, a group of rooms, or a single room that is occupied (or if vacant, is intended for occupancy) as separate living quarters. Occupants can be individuals, roommates, families who live together, or any other group of related or unrelated people who share living arrangements. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HOUSINGUNITTOTALSTOTHU_FY":{"type":"number","alias":"2029 Total Housing Units","vintage":"2029","source":"Esri","units":null,"decimals":null,"definition":"Esri 2029 five-year forecast for Total Housing Units (occupied or vacant) in the geographic area. Occupied Housing Units are currently occupied living quarterssuch as a house, apartment, mobile home, or roomsin which the occupant(s) live separately from individuals who are not part of their household and to which they have free, direct access. Occupants can be individuals, unrelated roommates, or families who live together. For vacant housing units, the living space criteria is identical to that of occupied units. Some nontraditional living quarterssuch as boats, RVs, and tentsare counted as housing units only when occupied if it is either the occupants usual residence or if the occupant has no other residence elsewhere. Importantly, these nontraditional living quarters are not counted as vacant housing units when unoccupied. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"AGEBYRACEBYSEX2010TOTHH10":{"type":"number","alias":"2010 Total Households","vintage":"2010","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2010 count of the Total Households in the geographic area. Total Households is the sum of all Households. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence.See <a target='_blank' href='https://links.esri.com/demographics/census-2010'>Census 2010</a> for more information on Census 2010."},"HOUSEHOLDTOTALSTOTHH20":{"type":"number","alias":"2020 Total Households","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"Total Households is the total of occupied housing units. The occupants may be one individual, a single family, two or more families living together, or any other group of related or unrelated individuals who share living arrangements. Occupied rooms or suites of rooms in hotels, motels, and similar places are classified as housing units only when occupied by permanent residents; that is, occupied by individuals who consider the hotel their usual place of residence or who have no usual place of residence elsewhere. However, when rooms in hotels and motels are used to provide shelter for people experiencing homelessness, they are not housing units. Rooms used in this way are considered group quarters. Source U.S. Census 2020 DHC. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"ATRISKTOTHH_CY":{"type":"number","alias":"2024 Total Households","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Total Households in the geographic area. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. A household may include related family members, unrelated people, a person living alone, or a group of unrelated people sharing a housing unit, such as partners or roommates. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"AGEBYRACEBYSEXTOTHH_FY":{"type":"number","alias":"2029 Total Households","vintage":"2029","source":"Esri","units":null,"decimals":null,"definition":"Esri 2029 five-year forecast for Total Households in the geographic area. Total Households is the sum of all Households. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. It excludes group quarters. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"OCCUPATIONOCCHLTH_CY":{"type":"number","alias":"2024 Occupation: Health Support","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the population age 16+ with Occupation: Healthcare Support in the geographic area. Data model based on data tables from the U.S. Census Bureau's American Community Survey (ACS) and Current Population Survey (CPS) and on information from the Bureau of Labor Statistics Occupational Employment Statistics (OES) and Current Employment Statistics (CES) programs. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"OCCUPATIONOCCPROT_CY":{"type":"number","alias":"2024 Occupation: Protective Service","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the population age 16+ with Occupation: Protective Service in the geographic area. Data model based on data tables from the U.S. Census Bureau's American Community Survey (ACS) and Current Population Survey (CPS) and on information from the Bureau of Labor Statistics Occupa ity measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"INDUSTRYACSINDOTSV":{"type":"number","alias":"2022 Emp 16+/Ind: Other Srvcs (ACS 5-Yr)","vintage":"2018-2022","source":"ACS","units":null,"decimals":null,"definition":"ACS five-year estimate of the Employed Civilian Population Age 16+ in Industry: Other Services (excluding Public Administration) in the geographic area. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"INDUSTRYACSINDPUBL":{"type":"number","alias":"2022 Emp 16+/Ind: Public Admin (ACS 5-Yr)","vintage":"2018-2022","source":"ACS","units":null,"decimals":null,"definition":"ACS five-year estimate of the Employed Civilian Population Age 16+ in Industry: Public Administration in the geographic area. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"WEALTHWLTHINDXCY":{"type":"number","alias":"2024 Wealth Index","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Wealth Index summarizes the wealth of a geographic area relative to the national level. Wealth is calculated from a number of indicators of affluence that include household income and average net worth. The concept of wealth is defined by more than just above-average household income; it also includes the value and abundance of material possessions and resources. Esri captures both aspects in its identification of the wealthiest areas in the country. The national index value is set to 100: values exceeding 100 represent above-average wealth while values below 100 represent below-average wealth. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSDIVINDX_CY":{"type":"number","alias":"2024 Diversity Index","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 estimated Diversity Index in the geographic area. Esri's Diversity Index summarizes racial and ethnic diversity, indicating the likelihood that two individuals, chosen at random from the same area, belong to the same race or ethnic group. The index ranges from 0 (no diversity) to 100 (highest diversity). An area's Diversity Index increases when the population includes more race/ethnic groups. <a target='_blank' href='https://links.esri.com/diversity-index'>read more</a> See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"CRIMECRMCYTOTC":{"type":"number","alias":"2024 Total Crime Index","vintage":"2024","source":"AGS","units":null,"decimals":null,"definition":"The Total Crime Index provides an assessment of the relative risk of seven major crime types: murder, rape, robbery, assault, burglary, larceny, and motor vehicle theft. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"HOUSEHOLDTOTALSHAI_CY":{"type":"number","alias":"2024 Housing Affordability Index","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Housing Affordability Index (HAI) measures the ability of a typical resident to purchase a home in the geographic area. The HAI has a base of 100, representing where the median income is sufficient to qualify for a loan on a median-valued home and not be cost-burdened (cost-burdened=greater than 30% of income spent on housing). HAI values > 100 indicate increasing affordability; HAI values < 100 indicate areas where homes are less affordable and median income might be insufficient to purchase a median-valued home.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"DISPOSABLEINCOMEMEDDI_CY":{"type":"number","alias":"2024 Median Disposable Income","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Median Disposable Income in the geographic area. Disposable Income represents money after taxes and provides an estimate of a household's purchasing power. Four types of taxes are deducted: federal individual income taxes, state individual income taxes, FICA (Social Security) and federal retirement payroll taxes, and property taxes for owner-occupied housing. Median Disposable Income divides disposable income distribution into two equal groups; half the population has disposable income higher than the median, and half lower. If the median is $200,000+, it is represented by a value of $200,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ATRISKACSHHBPOV_P":{"type":"number","alias":"2022 HHs: Inc Below Poverty Level (ACS 5-Yr): Percent","vintage":"2018-2022","source":"ACS","units":null,"decimals":null,"definition":"ACS five-year estimate of the number of Households with income Below the Poverty Level in the geographic area. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"CRIMECRMCYPERC":{"type":"number","alias":"2024 Personal Crime Index","vintage":"2024","source":"AGS","units":null,"decimals":null,"definition":"The Personal Crime Index provides an assessment of the relative risk of four major crime types: murder, rape, robbery, and assault. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"CRIMECRMCYMURD":{"type":"number","alias":"2024 Murder Index","vintage":"2024","source":"AGS","units":null,"decimals":null,"definition":"The Murder Index provides an assessment of the relative risk of murder. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Censusand AGS. Murder includes the willful killing of one human being by another.It includes murder and nonnegligent manslaughter as well as manslaughter by negligence. Deaths of persons due to their own negligence, accidental deaths not resulting from gross negligence, and traffic fatalities are not included. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"CRIMECRMCYRAPE":{"type":"number","alias":"2024 Rape Index","vintage":"2024","source":"AGS","units":null,"decimals":null,"definition":"The Rape Index provides an assessment of the relative risk of rape. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"CRIMECRMCYROBB":{"type":"number","alias":"2024 Robbery Index","vintage":"2024","source":"AGS","units":null,"decimals":null,"definition":"The Robbery Index provides an assessment of the relative risk of robbery. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS. Robbery is defined as the taking or attempting to take anything of value from the care, custody, or control of a person or persons by force or threat of force or violence and/or by putting the victim in fear. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"CRIMECRMCYASST":{"type":"number","alias":"2024 Assault Index","vintage":"2024","source":"AGS","units":null,"decimals":null,"definition":"The Assault Index provides an assessment of the relative risk of assault. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS.An assault is and unlawful attack by one person upon another for the purpose of inflicting severe or aggravated bodily injury. This type of assault usually is accompanied by the use of a weapon or by means likely to produce death or great bodily harm. Simple assaults are excluded. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"CRIMECRMCYPROC":{"type":"number","alias":"2024 Property Crime Index","vintage":"2024","source":"AGS","units":null,"decimals":null,"definition":"The Property Crime Index provides an assessment of the relative risk of three major crime types: burglary, larceny, and motor vehicle theft. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"CRIMECRMCYBURG":{"type":"number","alias":"2024 Burglary Index","vintage":"2024","source":"AGS","units":null,"decimals":null,"definition":"The Burglary Index provides an assessment of the relative risk of burglary. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS.Burglary is the unlawful entry of a structure to commit a felony or theft. Attempted forcible entry is included. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"CRIMECRMCYLARC":{"type":"number","alias":"2024 Larceny Index","vintage":"2024","source":"AGS","units":null,"decimals":null,"definition":"The Larceny Index provides an assessment of the relative risk of larceny and excludes motor vehicle theft. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS. Larceny is the unlawful taking, carrying, leading, or riding away of property from the possession or constructive possession of another. Examples are thefts of bicycles, motor vehicle parts and accessories, shoplifting, pocket-picking, or the stealing of any property or article that is not taken by force and violence or by fraud. Attempted larcenies are included. Embezzlement, confidence games, forgery, check fraud, etc. are excluded. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"CRIMECRMCYMVEH":{"type":"number","alias":"2024 Motor Vehicle Theft Index","vintage":"2024","source":"AGS","units":null,"decimals":null,"definition":"The Motor Vehicle Theft Index provides an assessment of the relative risk of motor vehicle theft. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS. It includes the theft or attempted theft of a motor vehicle. A motor vehicle is self-propelled and runs on land surface and not on rails. Motorboats, construction equipment, airplanes, and farming equipment are specifically excluded from this category. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"EDUCATIONALATTAINMENTNOHS_CY_P":{"type":"number","alias":"2024 Pop Age 25+: < 9th Grade: Percent","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of Population Age 25+ who completed Less than a 9th grade education in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EDUCATIONALATTAINMENTSOMEHS_CY_P":{"type":"number","alias":"2024 Pop Age 25+: High School/No Diploma: Percent","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of Population Age 25+ who completed some high school education (9-12th Grades in the United States) / No Diploma in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EDUCATIONALATTAINMENTHSGRAD_CY_P":{"type":"number","alias":"2024 Pop Age 25+: High School Diploma: Percent","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Population Age 25+ who earned a High School Diploma in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EDUCATIONALATTAINMENTGED_CY_P":{"type":"number","alias":"2024 Pop Age 25+: GED: Percent","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Population Age 25+ who earned a GED or alternative credential in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EDUCATIONALATTAINMENTSMCOLL_CY_P":{"type":"number","alias":"2024 Pop Age 25+: Some College/No Degree: Percent","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of Population Age 25+ who completed Some College without earning a degree in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EDUCATIONALATTAINMENTASSCDEG_CY_P":{"type":"number","alias":"2024 Pop Age 25+: Associate's Degree: Percent","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Population Age 25+ who earned an Associate's Degree in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EDUCATIONALATTAINMENTBACHDEG_CY_P":{"type":"number","alias":"2024 Pop Age 25+: Bachelor's Degree: Percent","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Population Age 25+ who earned a Bachelor's Degree in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EDUCATIONALATTAINMENTGRADDEG_CY_P":{"type":"number","alias":"2024 Pop Age 25+: Grad/Professional Degree: Percent","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Population Age 25+ who earned a Graduate or Professional degree in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"CUSTOM49701DC53A1242E0A2E81D28E2EEF5BA":{"type":"number","alias":"Services","vintage":null,"source":null,"units":null,"decimals":null},"CUSTOMDB8D513B99104168913181BC22320D62":{"type":"number","alias":"Blue Collar","vintage":null,"source":null,"units":null,"decimals":null},"CUSTOM3DAAA28EDA1F4459BD1BC3A523205F9B":{"type":"number","alias":"White Collar","vintage":null,"source":null,"units":null,"decimals":null}},"comparison_0":{"STORE_ID":{"type":"string","alias":"STORE_ID","vintage":null,"source":null,"units":null,"decimals":null},"AREA_ID":{"type":"string","alias":"AREA_ID","vintage":null,"source":null,"units":null,"decimals":null},"StdGeographyName":{"type":"string","alias":"Standard geography name","vintage":null,"source":null,"units":null,"decimals":null},"StdGeographyID":{"type":"string","alias":"Standard geography Id","vintage":null,"source":null,"units":null,"decimals":null},"StdGeographyLevel":{"type":"string","alias":"Standard geography level","vintage":null,"source":null,"units":null,"decimals":null},"POLICYDIVINDX10":{"type":"number","alias":"2010 Diversity Index","vintage":"2010","source":"U.S. Census","units":null,"decimals":null,"definition":"Esri 2010 calculation of Diversity Index in the geographic area. Esri's Diversity Index summarizes racial and ethnic diversity, indicating the likelihood that two individuals, chosen at random from the same area, belong to the same race or ethnic group. The index ranges from 0 (no diversity) to 100 (highest diversity). An area's Diversity Index increases when the population includes more race/ethnic groups. Based on U.S. Census 2010 data. See <a target='_blank' href='https://links.esri.com/demographics/census-2010'>Census 2010</a> for more information on Census 2010."},"HISPANICORIGINDIVINDX20":{"type":"number","alias":"2020 Diversity Index","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"The diversity index summarizes racial and ethnic diversity. The index shows the likelihood that two persons, chosen at random from the same area, belong to different race or ethnic groups. The index ranges from 0 (no diversity) to 100 (complete diversity). For example, a diversity index of 59 means there is a 59 percent probability that two people randomly chosen belong to different race or ethnic groups. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"KEYUSFACTSDIVINDX_CY":{"type":"number","alias":"2024 Diversity Index","vintag roup of rooms, or a single room that is occupied (or if vacant, is intended for occupancy) as separate living quarters.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSRENTER_FY_P":{"id":"RENTER_FY_P","fullName":"KeyUSFacts.RENTER_FY_P","alias":"2029 Renter Occupied HUs: Percent","fieldName":"KEYUSFACTSRENTER_FY_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSRENTER_FY_P","type":"esriFieldTypeDouble","vintage":"2029","source":"Esri","definition":"Esri 2029 five-year forecast for Renter-Occupied Housing Units in the geographic area. Renter-Occupied Housing Units are any occupied housing unit that is not Owner-Occupied, whether rented or occupied without payment of rent. Housing Units are living quarterssuch as a house, apartment, mobile home, or roomsin which the occupant(s) live separately from individuals who are not part of their household and to which they have free, direct access. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.POPULATIONTOTALSPOPGRW0020":{"id":"POPGRW0020","fullName":"populationtotals.POPGRW0020","alias":"2000-2020 Growth Rate: Population","fieldName":"POPULATIONTOTALSPOPGRW0020","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.POPULATIONTOTALSPOPGRW0020","type":"esriFieldTypeDouble","vintage":"2020","source":"U.S. Census","definition":"The 2000-2020 population compound annual growth rate (CAGR) is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of persons between the years 2000 and 2020. An annualized rate means that the resultant value reflects a rate of change covering a twelve-month time period. This component of the calculation permits the analysis of multiple growth rates between values measured from differing points in time since the change is computed using a common time period of twelve months. The compound component of the expression simply means that the annualized growth rate is repeated, or compounded, each year. Moreover, the CAGR can colloquially be referred to as growth rate, annual rate, annualized growth rate, or compound growth rate. See the variable formula used at: https://doc.arcgis.com/en/esri-demographics/reference/essential-vocabulary.htm See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"dataCollectionsCalculator.HOUSEHOLDTOTALSHHGRW0020":{"id":"HHGRW0020","fullName":"householdtotals.HHGRW0020","alias":"2000-2020 Growth Rate: Households","fieldName":"HOUSEHOLDTOTALSHHGRW0020","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSEHOLDTOTALSHHGRW0020","type":"esriFieldTypeDouble","vintage":"2020","source":"U.S. Census","definition":"The 2000-2020 household compound annual growth rate (CAGR) is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of households between the years 2000 and 2020. An annualized rate means that the resultant value reflects a rate of change covering a twelve-month time period. This component of the calculation permits the analysis of multiple growth rates between values measured from differing points in time since the change is computed using a common time period of twelve months. The compound component of the expression simply means that the annualized growth rate is repeated, or compounded, each year. Moreover, the CAGR can colloquially be referred to as growth rate, annual rate, annualized growth rate, or compound growth rate. See the variable formula used at: https://doc.arcgis.com/en/esri-demographics/reference/essential-vocabulary.htm See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"dataCollectionsCalculator.HOUSINGUNITTOTALSHUGRW0020":{"id":"HUGRW0020","fullName":"housingunittotals.HUGRW0020","alias":"2000-2020 Growth Rate: Housing Units","fieldName":"HOUSINGUNITTOTALSHUGRW0020","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSHUGRW0020","type":"esriFieldTypeDouble","vintage":"2020","source":"U.S. Census","definition":"The 2000-2020 housing unit compound annual growth rate (CAGR) is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of housing units between the years 2000 and 2020. An annualized rate means that the resultant value reflects a rate of change covering a twelve-month time period. This component of the calculation permits the analysis of multiple growth rates between values measured from differing points in time since the change is computed using a common time period of twelve months. The compound component of the expression simply means that the annualized growth rate is repeated, or compounded, each year. Moreover, the CAGR can colloquially be referred to as growth rate, annual rate, annualized growth rate, or compound growth rate. See the variable formula used at: https://doc.arcgis.com/en/esri-demographics/reference/essential-vocabulary.htm See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU10":{"id":"TOTHU10","fullName":"housingunittotals.TOTHU10","alias":"2010 Total Housing Units","fieldName":"HOUSINGUNITTOTALSTOTHU10","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU10","type":"esriFieldTypeDouble","vintage":"2010","source":"U.S. Census","definition":"U.S. Census 2010 count of the Total Housing Units in the geographic area. See <a target='_blank' //links.esri.com/demographics/2010-census'>Census 2010</a> for more information."},"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU20":{"id":"TOTHU20","fullName":"housingunittotals.TOTHU20","alias":"2020 Total Housing Units","fieldName":"HOUSINGUNITTOTALSTOTHU20","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU20","type":"esriFieldTypeDouble","vintage":"2020","source":"U.S. Census","definition":"Total Housing Units (occupied and vacant). Housing units are classified as being either occupied or vacant. These are living quarters in which the occupant or occupants live separately from any other individuals in the building and have direct access to their living quarters from outside the building or through a common hall. Housing units are usually houses, apartments, mobile homes, groups of rooms, or single rooms that are occupied as separate living quarters. They are residences for single individuals, for groups of individuals, or for families who live together. For vacant housing units, the criteria of separateness and direct access are applied to the intended occupants whenever possible. Nontraditional living quarters, such as boats, RVs, and tents, are considered housing units only if someone is living in them and they are either the occupants usual residence or the occupant has no usual residence elsewhere. These nontraditional living arrangements are not considered housing units if they are vacant. Source U.S. Census 2020 DHC. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"dataCollectionsCalculator.HISTORICALHOUSINGTOTHU_CY":{"id":"TOTHU_CY","fullName":"HistoricalHousing.TOTHU_CY","alias":"2024 Total Housing Units","fieldName":"HISTORICALHOUSINGTOTHU_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HISTORICALHOUSINGTOTHU_CY","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri","definition":"Esri 2024 Estimate of Total Housing Units, occupied or vacant, in the geographic area. A housing unit is a house, an apartment, a mobile home, a group of rooms, or a single room that is occupied (or if vacant, is intended for occupancy) as separate living quarters. Occupants can be individuals, roommates, families who live together, or any other group of related or unrelated people who share living arrangements. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU_FY":{"id":"TOTHU_FY","fullName":"housingunittotals.TOTHU_FY","alias":"2029 Total Housing Units","fieldName":"HOUSINGUNITTOTALSTOTHU_FY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU_FY","type":"esriFieldTypeDouble","vintage":"2029","source":"Esri","definition":"Esri 2029 five-year forecast for Total Housing Units (occupied or vacant) in the geographic area. Occupied Housing Units are currently occupied living quarterssuch as a house, apartment, mobile home, or roomsin which the occupant(s) live separately from individuals who are not part of their household and to which they have free, direct access. Occupants can be individuals, unrelated roommates, or families who live together. For vacant housing units, the living space criteria is identical to that of occupied units. Some nontraditional living quarterssuch as boats, RVs, and tentsare counted as housing units only when occupied if it is either the occupants usual residence or if the occupant has no other residence elsewhere. Importantly, these nontraditional living quarters are not counted as vacant housing units when unoccupied. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.AGEBYRACEBYSEX2010TOTHH10":{"id":"TOTHH10","fullName":"agebyracebysex2010.TOTHH10","alias":"2010 Total Households","fieldName":"AGEBYRACEBYSEX2010TOTHH10","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.AGEBYRACEBYSEX2010TOTHH10","type":"esriFieldTypeDouble","vintage":"2010","source":"U.S. Census","definition":"U.S. Census 2010 count of the Total Households in the geographic area. Total Households is the sum of all Households. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence.See <a target='_blank' href='https://links.esri.com/demographics/census-2010'>Census 2010</a> for more information on Census 2010."},"dataCollectionsCalculator.HOUSEHOLDTOTALSTOTHH20":{"id":"TOTHH20","fullName":"householdtotals.TOTHH20","alias":"2020 Total Households","fieldName":"HOUSEHOLDTOTALSTOTHH20","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSEHOLDTOTALSTOTHH20","type":"esriFieldTypeDouble","vintage":"2020","source":"U.S. Census","definition":"Total Households is the total of occupied housing units. The occupants may be one individual, a single family, two or more families living together, or any other group of related or unrelated individuals who share living arrangements. Occupied rooms or suites of rooms in hotels, motels, and similar places are classified as housing units only when occupied by permanent residents; that is, occupied by individuals who consider the hotel their usual place of residence or who have no usual place of residence elsewhere. However, when rooms in hotels and motels are used to provide shelter for people experiencing homelessness, they are not housing units. Room lator","templateName":"dataCollectionsCalculator.INDUSTRYACSINDPUBL","type":"esriFieldTypeDouble","vintage":"2018-2022","source":"ACS","definition":"ACS five-year estimate of the Employed Civilian Population Age 16+ in Industry: Public Administration in the geographic area. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"dataCollectionsCalculator.WEALTHWLTHINDXCY":{"id":"WLTHINDXCY","fullName":"Wealth.WLTHINDXCY","alias":"2024 Wealth Index","fieldName":"WEALTHWLTHINDXCY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.WEALTHWLTHINDXCY","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri","definition":"Esri 2024 Wealth Index summarizes the wealth of a geographic area relative to the national level. Wealth is calculated from a number of indicators of affluence that include household income and average net worth. The concept of wealth is defined by more than just above-average household income; it also includes the value and abundance of material possessions and resources. Esri captures both aspects in its identification of the wealthiest areas in the country. The national index value is set to 100: values exceeding 100 represent above-average wealth while values below 100 represent below-average wealth. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSDIVINDX_CY":{"id":"DIVINDX_CY","fullName":"KeyUSFacts.DIVINDX_CY","alias":"2024 Diversity Index","fieldName":"KEYUSFACTSDIVINDX_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSDIVINDX_CY","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri","definition":"Esri 2024 estimated Diversity Index in the geographic area. Esri's Diversity Index summarizes racial and ethnic diversity, indicating the likelihood that two individuals, chosen at random from the same area, belong to the same race or ethnic group. The index ranges from 0 (no diversity) to 100 (highest diversity). An area's Diversity Index increases when the population includes more race/ethnic groups. <a target='_blank' href='https://links.esri.com/diversity-index'>read more</a> See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.CRIMECRMCYTOTC":{"id":"CRMCYTOTC","fullName":"crime.CRMCYTOTC","alias":"2024 Total Crime Index","fieldName":"CRIMECRMCYTOTC","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.CRIMECRMCYTOTC","type":"esriFieldTypeDouble","vintage":"2024","source":"AGS","definition":"The Total Crime Index provides an assessment of the relative risk of seven major crime types: murder, rape, robbery, assault, burglary, larceny, and motor vehicle theft. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"dataCollectionsCalculator.HOUSEHOLDTOTALSHAI_CY":{"id":"HAI_CY","fullName":"householdtotals.HAI_CY","alias":"2024 Housing Affordability Index","fieldName":"HOUSEHOLDTOTALSHAI_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSEHOLDTOTALSHAI_CY","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri","definition":"Esri 2024 Housing Affordability Index (HAI) measures the ability of a typical resident to purchase a home in the geographic area. The HAI has a base of 100, representing where the median income is sufficient to qualify for a loan on a median-valued home and not be cost-burdened (cost-burdened=greater than 30% of income spent on housing). HAI values > 100 indicate increasing affordability; HAI values < 100 indicate areas where homes are less affordable and median income might be insufficient to purchase a median-valued home.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.DISPOSABLEINCOMEMEDDI_CY":{"id":"MEDDI_CY","fullName":"disposableincome.MEDDI_CY","alias":"2024 Median Disposable Income","fieldName":"DISPOSABLEINCOMEMEDDI_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.DISPOSABLEINCOMEMEDDI_CY","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri","definition":"Esri 2024 Estimate of the Median Disposable Income in the geographic area. Disposable Income represents money after taxes and provides an estimate of a household's purchasing power. Four types of taxes are deducted: federal individual income taxes, state individual income taxes, FICA (Social Security) and federal retirement payroll taxes, and property taxes for owner-occupied housing. Median Disposable Income divides disposable income distribution into two equal groups; half the population has disposable income higher than the median, and half lower. If the median is $200,000+, it is represented by a value of $200,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.ATRISKACSHHBPOV_P":{"id":"ACSHHBPOV_P","fullName":"AtRisk.ACSHHBPOV_P","alias":"2022 HHs: Inc Below Poverty Level (ACS 5-Yr): Percent","fieldName":"ATRISKACSHHBPOV_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ATRISKACSHHBPOV_P","type":"esriFieldTypeDouble","vintage":"2018-2022","source":"ACS","definition":"ACS five-year estimate of the number of Households with income Below the Poverty Level in the geographic area. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"dataCollectionsCalculator.CRIMECRMCYPERC":{"id":"CRMCYPERC","fullName":"crime.CRMCYPERC","alias":"2024 Personal Crime Index","fieldName":"CRIMECRMCYPERC","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.CRIMECRMCYPERC","type":"esriFieldTypeDouble","vintage":"2024","source":"AGS","definition":"The Personal Crime Index provides an assessment of the relative risk of four major crime types: murder, rape, robbery, and assault. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"dataCollectionsCalculator.CRIMECRMCYMURD":{"id":"CRMCYMURD","fullName":"crime.CRMCYMURD","alias":"2024 Murder Index","fieldName":"CRIMECRMCYMURD","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.CRIMECRMCYMURD","type":"esriFieldTypeDouble","vintage":"2024","source":"AGS","definition":"The Murder Index provides an assessment of the relative risk of murder. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Censusand AGS. Murder includes the willful killing of one human being by another.It includes murder and nonnegligent manslaughter as well as manslaughter by negligence. Deaths of persons due to their own negligence, accidental deaths not resulting from gross negligence, and traffic fatalities are not included. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"dataCollectionsCalculator.CRIMECRMCYRAPE":{"id":"CRMCYRAPE","fullName":"crime.CRMCYRAPE","alias":"2024 Rape Index","fieldName":"CRIMECRMCYRAPE","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.CRIMECRMCYRAPE","type":"esriFieldTypeDouble","vintage":"2024","source":"AGS","definition":"The Rape Index provides an assessment of the relative risk of rape. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"dataCollectionsCalculator.CRIMECRMCYROBB":{"id":"CRMCYROBB","fullName":"crime.CRMCYROBB","alias":"2024 Robbery Index","fieldName":"CRIMECRMCYROBB","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.CRIMECRMCYROBB","type":"esriFieldTypeDouble","vintage":"2024","source":"AGS","definition":"The Robbery Index provides an assessment of the relative risk of robbery. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS. Robbery is defined as the taking or attempting to take anything of value from the care, custody, or control of a person or persons by force or threat of force or violence and/or by putting the victim in fear. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"dataCollectionsCalculator.CRIMECRMCYASST":{"id":"CRMCYASST","fullName":"crime.CRMCYASST","alias":"2024 Assault Index","fieldName":"CRIMECRMCYASST","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.CRIMECRMCYASST","type":"esriFieldTypeDouble","vintage":"2024","source":"AGS","definition":"The Assault Index provides an assessment of the relative risk of assault. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS.An assault is and unlawful attack by one person upon another for the purpose of inflicting severe or aggravated bodily injury. This type of assault usually is accompanied by the use of a weapon or by means likely to produce death or great bodily harm. Simple assaults are excluded. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"dataCollectionsCalculator.CRIMECRMCYPROC":{"id":"CRMCYPROC","fullName":"crime.CRMCYPROC","alias":"2024 Property Crime Index","fieldName":"CRIMECRMCYPROC","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.CRIMECRMCYPROC","type":"esriFieldTypeDouble","vintage":"2024","source":"AGS","definition":"The Property Crime Index provides an assessment of the relative risk of three major crime types: burglary, larceny, and motor vehicle theft. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"dataCollectionsCalculator.CRIMECRMCYBURG":{"id":"CRMCYBURG","fullName":"crime.CRMCYBURG","alias":"2024 Burglary Index","fieldName":"CRIMECRMCYBURG","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.CRIMECRMCYBURG","type":"esriFieldTypeDouble","vintage":"2024","source":"AGS","definition":"The Burglary Index provides an assessment of the relative risk of burglary. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS.Burglary is the unlawful entry of a structure to commit a felony or theft. Attempted forcible entry is included. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"dataCollectionsCalculator.CRIMECRMCYLARC":{"id":"CRMCYLARC","fullName":"crime.CRMCYLARC","alias":"2024 Larceny Index","fieldName":"CRIMECRMCYLARC","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.CRIMECRMCYLARC","type":"esriFieldTypeDouble","vintage":"2024","source":"AGS","definition":"The Larceny Index provides an assessment of the relative risk of larceny and excludes motor vehicle theft. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS. Larceny is the unlawful taking, carrying, leading, or riding away of property from the possession or constructive possession of another. Examples are thefts of bicycles, motor vehicle parts and accessories, shoplifting, pocket-picking, or the stealing of any property or article that is not taken by force and violence or by fraud. Attempted larcenies are included. Embezzlement, confidence games, forgery, check fraud, etc. are excluded. See <a target='_blank' href='https://links.esri.com/demographics/crime-indexes'>Crime Indexes</a> for more information."},"dataCollectionsCalculator.CRIMECRMCYMVEH":{"id":"CRMCYMVEH","fullName":"crime.CRMCYMVEH","alias":"2024 Motor Vehicle Theft Index","fieldName":"CRIMECRMCYMVEH","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.CRIMECRMCYMVEH","type":"esriFieldTypeDouble","vintage":"2024","source":"AGS","definition":"The Motor Vehicle Theft Index provides an assessment of the relative risk of motor vehicle theft. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS. It includes the theft or attempted theft of a motor vehicle. A motor vehicle is self-propelled and runs on land surface and not on rails. Motorboats, construction equipment, airplanes, and farming equipment are specifically excluded from this category. See <a target='_blank' href='https://links. ont size='3'>Use this Map</font></div><div><font size='3'><br /></font></div><div>This map is designed to be used as a basemap for overlaying other layers of information or as a stand-alone reference map. You can add layers to this web map and save as your own map. If you like, you can add this web map to a custom basemap gallery for others in your organization to use in creating web maps. If you would like to add this map as a layer in other maps you are creating, you may use the<a href='https://www.arcgis.com/home/item.html?id=273bf8d5c8ac400183fc24e109d20bcf' rel='nofollow ugc' target='_blank'>Community</a>tile layer referenced in this map.</div><div><br /></div><div><font size='3'>Customize this Map</font></div><div><br /></div><div>Because this map includes a vector tile layer, you can customize the map to change its content and symbology. You are able to turn on and off layers, change symbols for layers, switch to alternate local language (in some areas), and refine the treatment of disputed boundaries. For details on how to customize this map, please refer to the<a href='https://www.arcgis.com/home/item.html?id=c908722b0841404ba6a87d6221f201e4' rel='nofollow ugc' target='_blank'>Esri Vector Basemap Reference Document (v2)</a>and vector basemap articles on the<a href='https://www.esri.com/arcgis-blog/?s=#vector+basemaps' rel='nofollow ugc' target='_blank'>ArcGIS Online Blog</a>.</div><div><br /></div><div>Fonts available for use in the style resource directory are under the<a href='https://scripts.sil.org/cms/scripts/page.php?site_id=nrsi&amp;id=OFL_web' rel='nofollow ugc' target='_blank'>OFL, Open Font License</a>.</div><div><br /></div><div>This map was designed and created by Cindy Prostak.</div><div><br /></div>","tags":["esri_basemap","creative","Cindy Prostak","general availability","wma","v2","basemaps","vector","basemap"],"snippet":"This web map provides a detailed vector tile basemap for the world featuring a style that is optimized to display special
